import React from 'react';

const StaffList = ({ staff }) => {
  return (
    <div className="outerBox">
      {staff.map((staffName, index) => (
        <div key={index} className="staffName">
          {staffName}
        </div>
      ))}
    </div>
  );
};

export default StaffList;
